import React, { Component } from 'react';
import { Link, Redirect } from 'react-router-dom';
import { Table } from 'react-bootstrap';

class Busca_Voo_Matricula extends Component {
    constructor(props){
        super(props);
    }
    render() {
        return (
            <Table dark>
                <thead>
                    <tr>
                        <th>ID Voo</th>
                    </tr>
                </thead>
                <tbody>
                    <tr>
                        <td>{this.props.dados_voo_aluno}</td>
                    </tr>
                </tbody>
            </Table>
        )
      }
}
export default Busca_Voo_Matricula;
